          <script>
              function showDepartment(prefix, chooser) {
                  var selectedOption = (chooser.options[chooser.selectedIndex].value);
                  if (selectedOption == '20221') {
                      var div = document.getElementById(prefix);
                      div.style.display = 'block';
                      showSubject('disciplinas20221');
                  }
                  else if (selectedOption == '20222') {
                      var div = document.getElementById(prefix);
                      div.style.display = 'block';
                      showSubject('disciplinas20222');
                  }
                  else if (selectedOption == '20223') {
                      var div = document.getElementById(prefix);
                      div.style.display = 'block';
                      showSubject('disciplinas20223');
                  }
                  else {
                      var div = document.getElementById(prefix + "0");
                      div.style.display = 'None';
                  }
              }
      
              function showSubject(prefix) {
                  if (prefix == "disciplinas20221") {
                      var div = document.getElementById(prefix);
                      div.style.display = 'block';
                      showClass('turmas20221');
                  }
                  else if (prefix == "disciplinas20222") {
                      var div = document.getElementById(prefix);
                      div.style.display = 'block';
                      showClass('turmas20222');
                  }
                  else if (prefix == "disciplinas20231") {
                      var div = document.getElementById(prefix);
                      div.style.display = 'block';
                      showClass('turmas20231');
                  }
                  else {
                      var div = document.getElementById(prefix + "0");
                      div.style.display = 'None';
                  }
              }
      
              function showClass(prefix) {
                  if (prefix == "turmas20221") {
                      var div = document.getElementById(prefix);
                      div.style.display = 'block';
                      showRating('success');
                  }
                  else if (prefix == "turmas20222") {
                      var div = document.getElementById(prefix);
                      div.style.display = 'block';
                      showRating('success');
                  }
                  else if (prefix == "turmas20231") {
                      var div = document.getElementById(prefix);
                      div.style.display = 'block';
                      showRating('success');
                  }
                  else {
                      var div = document.getElementById(prefix + "0");
                      div.style.display = 'None';
                      showRating('fail');
                  }
              }

              function showRating(prefix) {
                if (prefix == "success") {
                    var div = document.getElementById('nota');
                    div.style.display = 'block';
                }
                else {
                  var div = document.getElementById(prefix + "0");
                  div.style.display = 'None';
              }
            }
